import Analysis from '../Analysis';
import Summary from '../Summary';
import {useParams} from 'react-router-dom'
const Result = () => {
    const {id} = useParams()
    return (
        <>
            <Summary />
            <Analysis />
        </>
    )
}

export default Result;
